import React, { useState, useEffect } from "react";
import { fetchContributionData } from "../services/fetchCommits";

const Dashboard = () => {
    // Updated Users & Repositories
    const USERS = [
        "ArulTEG",
        "ArunPrem_APP",
        "deepesh-tech",
        "Mukul Kumar",
        "suneelkumar02",
        "dhorinaresh"
    ];
    const REPOSITORIES = [
        "LobbyClientUI-R1",
        "LobbyAdminServerAPI-R1",
        "LobbyHeartbeatAutomationUI-R1",
        "HubspotIntegrationAPI-R1",
        "LobbyMiddlewareAPI-R1",
        "LobbyAdminPanelUI-R1",
        "LobbyServerAPI-R1"
    ];

    const [selectedUser, setSelectedUser] = useState("");
    const [selectedRepo, setSelectedRepo] = useState("");
    const [contributions, setContributions] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const handleExecute = async () => {
        setLoading(true);
        setError(null);

        try {
            const data = await fetchContributionData();
            const filteredData = data.filter(entry =>
                (selectedUser ? entry.user === selectedUser : true) &&
                (selectedRepo ? entry.repository === selectedRepo : true)
            );

            setContributions(filteredData);
        } catch (err) {
            setError("Failed to fetch data.");
            console.error(err);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div style={{ padding: "20px" }}>
            <h2>GitHub Contributions Dashboard</h2>

            {/* Filters Section */}
            <div style={{ display: "flex", gap: "10px", marginBottom: "20px" }}>
                {/* User Dropdown */}
                <select value={selectedUser} onChange={e => setSelectedUser(e.target.value)}>
                    <option value="">All Users</option>
                    {USERS.map(user => (
                        <option key={user} value={user}>{user}</option>
                    ))}
                </select>

                {/* Repository Dropdown */}
                <select value={selectedRepo} onChange={e => setSelectedRepo(e.target.value)}>
                    <option value="">All Repositories</option>
                    {REPOSITORIES.map(repo => (
                        <option key={repo} value={repo}>{repo}</option>
                    ))}
                </select>

                {/* Execute Button */}
                <button onClick={handleExecute} style={{ padding: "5px 10px" }}>
                    {loading ? "Loading..." : "Execute"}
                </button>
            </div>

            {/* Error Handling */}
            {error && <p style={{ color: "red" }}>{error}</p>}

            {/* Display Contribution Data */}
            <table border="1" cellPadding="10">
                <thead>
                    <tr>
                        <th>User</th>
                        <th>Repository</th>
                        <th>Commits</th>
                        <th>Percentage</th>
                    </tr>
                </thead>
                <tbody>
                    {loading ? (
                        <tr>
                            <td colSpan="4" style={{ textAlign: "center" }}>Loading...</td>
                        </tr>
                    ) : contributions.length > 0 ? (
                        contributions.map((entry, index) => (
                            <tr key={index}>
                                <td>{entry.user}</td>
                                <td>{entry.repository}</td>
                                <td>{entry.count}</td>
                                <td>{entry.percentage}%</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="4" style={{ textAlign: "center" }}>No Data Available</td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
};

export default Dashboard;
